import React, { useState, useEffect } from 'react';
import { View, Text, StyleSheet, TextInput, TouchableOpacity, ScrollView, Linking } from 'react-native';
import AsyncStorage from '@react-native-async-storage/async-storage';

function MarcarConsultas({ route, navigation }) {
  const { cliente } = route.params || {};
  const { adicionarConsultaId } = route.params;
  const [dataConsulta, setDataConsulta] = useState('');
  const [horaConsulta, setHoraConsulta] = useState('');
  const [observacao, setObservacao] = useState('');

  useEffect(() => {
    navigation.setOptions({
      headerRight: () => (
        <TouchableOpacity onPress={handleEnviarConsulta}>
          <Text style={styles.headerButtonText}>Enviar</Text>
        </TouchableOpacity>
      ),
    });
  }, [navigation]);

  const adicionarConsulta = adicionarConsultaMarcada;

  const handleEnviarConsulta = () => {
    const mensagem = `Olá ${cliente.nome}, sua consulta foi agendada para o dia ${dataConsulta} às ${horaConsulta}.`;
    const url = `https://api.whatsapp.com/send?phone=${cliente.numeroTelefone}&text=${encodeURIComponent(mensagem)}`;
    Linking.openURL(url);
  };

  const handleSalvarConsulta = async () => {
    try {
      const consultasSalvas = await AsyncStorage.getItem('Consultas');
      let consultas = [];
  
      if (consultasSalvas !== null) {
        consultas = JSON.parse(consultasSalvas);
      }
  
      consultas.push({
        clienteId: cliente.id,
        clienteNome: cliente.nome, // Adicione o nome do cliente aqui
        dataConsulta,
        horaConsulta,
        observacao,
      });
  
      await AsyncStorage.setItem('Consultas', JSON.stringify(consultas));
      console.log('Consulta agendada com sucesso!');
  
      setDataConsulta('');
      setHoraConsulta('');
      setObservacao('');
  
    } catch (error) {
      console.log('Erro ao salvar a consulta:', error);
    }
  };

  function adicionarConsultaMarcada(consulta) {
    // Implemente sua lógica aqui
  }

  return (
    <View style={styles.container}>
      <View style={styles.laudoContainer}>
        <Text style={styles.laudoTitle}>Laudo do Cliente</Text>
        <Text style={styles.laudoText}>Nome: {cliente ? cliente.nome : ''}</Text>
        <Text style={styles.laudoText}>CPF: {cliente ? cliente.cpf : ''}</Text>
        <Text style={styles.laudoText}>Data de Nascimento: {cliente ? cliente.dataNascimento : ''}</Text>
      </View>
      <ScrollView style={styles.scrollContainer}>
        <View style={styles.formContainer}>
          <Text style={styles.label}>Data da Consulta:</Text>
          <TextInput
            style={styles.input}
            placeholder="Digite a data da consulta"
            value={dataConsulta}
            onChangeText={setDataConsulta}
          />
          <Text style={styles.label}>Hora da Consulta:</Text>
          <TextInput
            style={styles.input}
            placeholder="Digite a hora da consulta"
            value={horaConsulta}
            onChangeText={setHoraConsulta}
          />
          <Text style={styles.label}>Observação:</Text>
          <TextInput
            style={styles.input}
            placeholder="Digite uma observação"
            value={observacao}
            onChangeText={setObservacao}
            multiline
          />
          <TouchableOpacity style={styles.button} onPress={handleSalvarConsulta}>
            <Text style={styles.buttonText}>Salvar</Text>
          </TouchableOpacity>
        </View>
      </ScrollView>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    paddingTop: '15%',
    flex: 1,
    backgroundColor: '#fff',
  },
  laudoContainer: {
    paddingHorizontal: 20,
    paddingTop: 20,
  },
  laudoTitle: {
    fontSize: 18,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  laudoText: {
    fontSize: 16,
    marginBottom: 5,
  },
  scrollContainer: {
    flex: 1,
    marginTop: 20,
    paddingHorizontal: 20,
  },
  formContainer: {
    marginBottom: 20,
  },
  label: {
    fontSize: 16,
    fontWeight: 'bold',
    marginBottom: 5,
  },
  input: {
    height: 40,
    borderColor: '#ccc',
    borderWidth: 1,
    borderRadius: 5,
    paddingHorizontal: 10,
    marginBottom: 10,
  },
  button: {
    backgroundColor: '#000',
    alignItems: 'center',
    justifyContent: 'center',
    height: 40,
    borderRadius: 5,
  },
  buttonText: {
    color: '#fff',
    fontSize: 16,
  },
  headerButtonText: {
    color: '#000',
    fontSize: 16,
    marginRight: 10,
  },
});

export default MarcarConsultas;
